caption.text:
@irwanmul @adelinechiara @graciaoctavera @adityazulfahmi I have a limited time to stay in Indonesia because this July I am leaving Indo, I haven't got the chance at all to see Disclosure everywhere. I listened to their songs since Latch in 2014 and until now I am still in love with it more importantly I am fond of their new track Magnets. I'm hoping to get these free tickets because I wanted to at least spend my last time seeing them before moving or leaving Indonesia. It will bring me tears able to join the crazy crowd partying with Indonesian. Indonesia is cool and bright, I love Indonesia and I would love to see Disclosure in Indonesia with my friends :) please choose me, I really wanted the ticket so bad just to spend my last time having fun with friends while I'm here :) #JAKCLUBTIX #GETFREETICKET

